import React, { useEffect } from 'react';

const CodeSnippetComponent = () => {
  useEffect(() => {
    // Add CSS animations to document head
    const style = document.createElement('style');
    style.textContent = `
      @keyframes fadeInCode {
        0% {
          opacity: 0;
          transform: translateX(30px);
        }
        100% {
          opacity: 1;
          transform: translateX(0);
        }
      }
    `;
    document.head.appendChild(style);

    return () => {
      // Clean up the style element
      if (style.parentNode) {
        style.parentNode.removeChild(style);
      }
    };
  }, []);

  return (
    <div style={{
      position: 'fixed',
      right: '2rem',
      top: '50%',
      transform: 'translateY(-50%)',
      width: '380px',
      background: 'rgba(255, 255, 255, 0.03)',
      backdropFilter: 'blur(20px)',
      border: '1px solid rgba(255, 255, 255, 0.15)',
      borderRadius: '16px',
      padding: '2rem',
      zIndex: 100,
      boxShadow: '0 12px 40px rgba(0, 0, 0, 0.4)',
      animation: 'fadeInCode 1.5s ease-out',
      fontFamily: "'Monaco', 'Consolas', 'Courier New', monospace"
    }}>
      <div style={{
        fontSize: '14px',
        lineHeight: '1.8',
        color: '#e5e5e5'
      }}>
        <div style={{ color: '#ff77c6', marginBottom: '0.5rem' }}>
          <span style={{ color: '#7dd3fc' }}>const</span>{' '}
          <span style={{ color: '#86efac' }}>siddhant</span>{' '}
          <span style={{ color: '#e5e5e5' }}>=</span>{' '}
          <span style={{ color: '#fde047' }}>{'{'}</span>
        </div>

        <div style={{ paddingLeft: '1rem' }}>
          <div style={{ marginBottom: '0.3rem' }}>
            <span style={{ color: '#86efac' }}>education</span>
            <span style={{ color: '#e5e5e5' }}>:</span>{' '}
            <span style={{ color: '#fde047' }}>'Stanford University'</span>
            <span style={{ color: '#e5e5e5' }}>,</span>
          </div>

          <div style={{ marginBottom: '0.3rem' }}>
            <span style={{ color: '#86efac' }}>focus</span>
            <span style={{ color: '#e5e5e5' }}>:</span>{' '}
            <span style={{ color: '#e5e5e5' }}>[</span>
            <span style={{ color: '#fde047' }}>'ML'</span>
            <span style={{ color: '#e5e5e5' }}>,</span>{' '}
            <span style={{ color: '#fde047' }}>'Finance'</span>
            <span style={{ color: '#e5e5e5' }}>,</span>{' '}
            <span style={{ color: '#fde047' }}>'Math'</span>
            <span style={{ color: '#e5e5e5' }}>],</span>
          </div>

          <div style={{ marginBottom: '0.3rem' }}>
            <span style={{ color: '#86efac' }}>passion</span>
            <span style={{ color: '#e5e5e5' }}>:</span>{' '}
            <span style={{ color: '#fde047' }}>'Quantitative Innovation'</span>
          </div>
        </div>

        <div style={{ color: '#fde047' }}>
          {'};'}
        </div>
      </div>

      {/* Subtle glow effect */}
      <div style={{
        position: 'absolute',
        top: '-2px',
        left: '-2px',
        right: '-2px',
        bottom: '-2px',
        background: 'linear-gradient(45deg, rgba(120, 119, 198, 0.2), rgba(255, 119, 198, 0.2))',
        borderRadius: '18px',
        zIndex: -1,
        opacity: 0,
        transition: 'opacity 0.3s ease'
      }}
      onMouseEnter={(e) => e.currentTarget.style.opacity = '1'}
      onMouseLeave={(e) => e.currentTarget.style.opacity = '0'}
      />
    </div>
  );
};

export default CodeSnippetComponent;
